INSERT INTO `msf_apis` (`api_id`, `api_name`, `api_url`, `api_desc`) VALUES
(1, 'Current Season', 'https://api.mysportsfeeds.com/v2.1/pull/mlb/current_season.{format}', 'Returns the current season and supported stats, for a given date.'),
(2, 'Daily DFS', 'https://api.mysportsfeeds.com/v2.1/pull/mlb/{season}/date/{date}/dfs.{format}', 'A list of slates with games/contests/players, including salaries and fantasy points.'),
(3, 'Daily Futures (Odds)', 'https://api.mysportsfeeds.com/v2.1/pull/mlb/{season}/date/{date}/odds_futures.{format}', 'All Futures (Odds) entries applicable for a given date including line history.'),
(4, 'Daily Game Lines (Odds)', 'https://api.mysportsfeeds.com/v2.1/pull/mlb/{season}/date/{date}/odds_gamelines.{format}', 'All Game Lines (Odds) entries for a given date including line history.'),
(5, 'Daily Games', 'https://api.mysportsfeeds.com/v2.1/pull/mlb/{season}/date/{date}/games.{format}', 'All games on a given date including schedule, status and scores.'),
(6, 'Daily Player Gamelogs', 'https://api.mysportsfeeds.com/v2.1/pull/mlb/{season}/date/{date}/player_gamelogs.{format}', 'All player game logs for a date including game and stats.'),
(7, 'Daily Team Gamelogs', 'https://api.mysportsfeeds.com/v2.1/pull/mlb/{season}/date/{date}/team_gamelogs.{format}', 'All team game logs for a date including game and stats'),
(8, 'Game Boxscore', 'https://api.mysportsfeeds.com/v2.1/pull/mlb/{season}/games/{game}/boxscore.{format}', 'A boxscore for a game including game details and team/player stats.'),
(9, 'Game Lineup', 'https://api.mysportsfeeds.com/v2.1/pull/mlb/{season}/games/{game}/lineup.{format}', 'Lists the expected and actual lineups for a game.'),
(10, 'Game Play-By-Play', 'https://api.mysportsfeeds.com/v2.1/pull/mlb/{season}/games/{game}/playbyplay.{format}', 'All play-by-play events for a game with full details.'),
(11, 'Latest Updates', 'https://api.mysportsfeeds.com/v2.1/pull/mlb/{season}/latest_updates.{format}', 'Lists all the latest update timestamps for each feed.'),
(12, 'Player Injuries', 'https://api.mysportsfeeds.com/v2.1/pull/mlb/injuries.{format}', 'A list of all currently injured players.'),
(13, 'Players', 'https://api.mysportsfeeds.com/v2.1/pull/mlb/players.{format}', 'Lists all players for a league on a given date, with full bio and other details.'),
(14, 'Seasonal DFS', 'https://api.mysportsfeeds.com/v2.1/pull/mlb/{season}/dfs.{format}', 'A list of slates with games/contests/players, including salaries and fantasy points.'),
(15, 'Seasonal Game Lines (Odds)', 'https://api.mysportsfeeds.com/v2.1/pull/mlb/{season}/odds_gamelines.{format}', 'All Game Lines (Odds) for a season including line history.'),
(16, 'Seasonal Games', 'https://api.mysportsfeeds.com/v2.1/pull/mlb/{season}/games.{format}', 'All games for a season including schedule, status and scores.'),
(17, 'Seasonal Player Gamelogs', 'https://api.mysportsfeeds.com/v2.1/pull/mlb/{season}/player_gamelogs.{format}', 'All player game logs for a season including game and stats.'),
(18, 'Seasonal Player Stats', 'https://api.mysportsfeeds.com/v2.1/pull/mlb/{season}/player_stats_totals.{format}', 'Lists each player along with their seasonal stats totals on a given day.'),
(19, 'Seasonal Standings', 'https://api.mysportsfeeds.com/v2.1/pull/mlb/{season}/standings.{format}', 'Lists all teams along with their stats and overall/conf/div/playoff rankings, on a given day.'),
(20, 'Seasonal Team Gamelogs', 'https://api.mysportsfeeds.com/v2.1/pull/mlb/{season}/team_gamelogs.{format}', 'All team game logs for a season including game and stats.'),
(21, 'Seasonal Team Stats', 'https://api.mysportsfeeds.com/v2.1/pull/mlb/{season}/team_stats_totals.{format}', 'Lists each team along with their seasonal stats totals on a given day.'),
(22, 'Seasonal Venues', 'https://api.mysportsfeeds.com/v2.1/pull/mlb/{season}/venues.{format}', 'Lists all venues used in a league\'s specific season.');
